import * as Styled from './styles'


export const MovieRow = ({  title, items }) =>{


    return(
        <div >
            <h2>{title}</h2>
            <Styled.ListArea>
                {items.results.lenght > 0 && items.results.map((item, key)=>{
                    return (
                        <img src={`https://image.tmdb.org/t/p/w300/62qfVDg4VK3kqZFxrRztPqSbal4.jpg`} />
                    )
                })}
            </Styled.ListArea>
        </div>
    )
}
